description:
The powerful SD70ACe is a popular sight across the US freight railroad network and is now available for Train Simulator in six Union Pacific attractive fallen flag heritage liveries - Denver &amp; Rio Grande Western, Missouri Pacific, Western Pacific, Missouri-Kansas-Texas, Chicago &amp; North Western, and Southern Pacific. 

Also included are Union Pacific freight cars - Auto Rack Car, Box Car, Cement Hopper, Double Stack Car, Low Gondola and Wood Chip Gondola

The locomotives are Quick Drive compatible, giving you the freedom to drive the Union Pacific Heritage SD70ACes on any Quick Drive enabled route for Train Simulator.



Please support the developers and buy some of their content if you can afford it.


Please use the email address for requests and questions and if you want to share an addon with the community then contact us and we will post it on your behalf. If you would like to contribute, please read the Readme.pdf.


